import React from 'react'

const Statusbox = ({ text, section, bar_color, percentage }) => {
  return (
    <li className="status box light-theme" id="status2" value=''>
        <p className="st-text1">{text}</p>
        {section.length>0 && <p className="st-text2">{section}</p>}
        <div className="bar-wrap bar1-ar-wrap light-theme">
            <div className="bar bar1-ar light-theme" style={{ backgroundColor: bar_color, width: percentage+'%' }}></div>
        </div>
        <p className="st-text3">{percentage}%</p>
        <p className="st-text4 light-theme">スタート!</p>
    </li> 
  )
}

export default Statusbox
